import React from "react";
import logo from "../../images/logo_2.png";
import ("../../components/Nav/style.css");

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark">
    <div className="col-md">
      <a className="navbar-brand" href="/">
      
      <img src={logo} alt="logo"/>
      A picture is worth a thousand words...
      </a>
      </div>
      <div className="col-md"></div>
      <div className="col-md">
      <button type="button" class="btn btn-outline-light btn-lg" style={{alignSelf:"left"}}>Light</button>
      <button type="button" class="btn btn-outline-light" style={{alignSelf:"left"}}>Light</button>

      </div>
    </nav>
  );
}



/*export function Navie() {
  return (
    <div className="navbar">
    
      <a href=""> A picture is worth a thousand words...</a>
      <a href="">Sign IN</a>
      </div>
     

      </div>
   
  )
}*/
export default Nav;
